'''Laura Bailey''' (born May 28, 1981) is an American actress and singer She provides voices for a number of English-language versions of Japanese anime films and television series as well as voice roles in cartoons and video games.

In ''[[Game of Thrones: A Telltale Games Series]]'', she voices [[Gwyn Whitehill]].
